description:
After conquering Spain, Napoleon Bonaparte sent a powerful army to invade Portugal in 1810. The French plowed through the resistance mounted against them until, as they approached Lisbon, they were met by a combined British and Portuguese army under the command of the Viscount Wellington. Thats the general historical outline for Valeria Sarmientos extraordinarily intimate epic of the Peninsular War. Along the way, we witness love affairs and treachery, noble action and selfish cruelty, from the highest social echelons to the most humble quarters.

